import './App.css';
import HelloCGU from './cgu_hello';
import Login from './login';
import BackImage from "./background";

function App(){
  return (
    <div className="App">

        {BackImage()}
        {HelloCGU()}
        <div>
          {Login()}
        </div>

    </div>
  );
}

export default App;
